t(\"explained_variance ,singular_values: \", explained_variance.result(), \" and \" , singular_values.result(), flush=True)\nprint(\"Done in :\", time.perf_counter() - t, flush=True)\n\nclient.shutdown()\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{"num_minor_ticks":5,"tickers":[{"id":"1322"},{"id":"1323"},{"id":"1324"},{"id":"1325"},{"id":"1326"},{"id":"1327"},{"id":"1328"},{"id":"1329"},{"id":"1330"},{"id":"1331"},{"id":"1332"},{"id":"1333"}]},"id":"1293","type":"DatetimeTicker"},{"attributes":{"coordinates":null,"formatter":{"id":"1318"},"group":null,"major_label_policy":{"id":"1319"},"ticker":{"id":"1293"}},"id":"1292","type":"DatetimeAxis"},{"attributes":{"source":{"id":"1110"}},"id":"1136","type":"CDSView"},{"attributes":{"base":1024,"mantissas":[1,2,4,8,16,32,64,128,256,512]},"id":"1209","type":"AdaptiveTicker"},{"attributes":{"child":{"id":"1039"},"title":"Scheduler Profile (administrative)"},"id":"1405","type":"Panel"},{"attributes":{"source":{"id":"1181"}},"id":"1206","type":"CDSView"},{"attributes":{"axis_label":"Bytes","coordinates":null,"formatter":{"id":"1366"},"group":null,"major_label_policy":{"id":"1482"},"ticker":{"id":"1264"}},"id":"1263","type":"LinearAxis"},{"attributes":{"coordinates":null,"group":null,"text":"Bandwidth"},"id":"1283","type":"Title"}],"root_ids":["1411"]},"title":"Bokeh Application","version":"2.4.1"}}
